import React from "react";

import { useAuth0 } from "@auth0/auth0-react";

const Profile = () => {
  const { user } = useAuth0();
  const { name } = user;

  return (

    <div className="col-md text-center text-md-left">
        <h2>{name}</h2>
    </div>
  );
};

export default Profile;
